const Menu = ({items}) => {
  return ( 
    <div className="menu">
      <div className="blur"></div>
      <div className="menu__content">
        <ul>
          {items.map(item => {
            <li>
              <a href="#">{item.value}</a>
            </li>
          })}
        </ul>
      </div>
    </div>
  );
}

export default Menu;
